    <>
    <Map google={this.props.google} zoom={10}  style = {{width : "100%" , height:"600px"}}
    inialCenter = {{
      lat: 37.42216,
      lng: -122.08427,
    }}
    />
        </>
  )
}

export default GoogleApiWrapper({
    apiKey: "AIzaSyCpZK-LJwd9gsBwxZnCBYhXtogDJ1RulVM"
  })(MapContainer)
